var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': '繪圖', 'text': '', 'tags': '', 'url': '繪圖.html'}, {'title': 'Inventor 2019', 'text': '', 'tags': '', 'url': 'Inventor 2019.html'}, {'title': 'NX 12', 'text': '', 'tags': '', 'url': 'NX 12.html'}, {'title': 'Solidworks', 'text': 'soliworks\xa0 brief\xa0 history \n \xa0 \xa0 \xa0 \xa0 Soliworks是由Jon Hirschtick於1993年12月創立的，Jon Hirschtick用100萬美元成立了該公司。 之後Hirschtick招募了一組工程師，他們的目標是創建3D CAD軟件，並且希望這個軟體能夠讓Windows系統的介面成功運作並適合Windows去利用。 \n \xa0 \xa0 \xa0 \xa0 1995年11月，SolidWorks很快發布了。它是Windows的第一個而且也很重要的建模器。事實證明這是CAD後續發展的重要一步，雖然AutoCAD發行得比Soliworks早得多，但SolidWorks為也帶來了新的東西-「3D建模」。因此，3D CAD成為1990年代的焦點。在短短幾個月內，SolidWorks改變了工程師將「創造變為現實」的方式。 \n \xa0 \xa0 \xa0 \xa0 SolidWorks實在令人印象深刻，以至於1997年，它被達索系統公司（DassaultSystèmes）以3.2億美元的驚人股票收購，Jon Hirschtick在接下來的14年留任，在他的領導下，SolidWorks也成功的成長為收入達1億美元的公司。 赫希提克後來離開，創立了另一家我們熟悉的公司Onshape。 \n \xa0 \xa0 \xa0 \xa0\xa0\xa0當SolidWorks於1995年首次發佈時，它確實改變了遊戲規則，有了它，首選平台就從UNIX轉移到了PC， 軟件的成本也從18,000美元變到4,000美元，所需的培訓被大量壓縮為幾天。不用說，SolidWorks徹底改變了每個工程師的桌面。自成立以來，SolidWorks已有了26個版本，每個版本都提供更多功能和增強功能。 \n Soliworks practice \n https://www.youtube.com/watch?v=ZkHTpLE2LiQ', 'tags': '', 'url': 'Solidworks.html'}, {'title': 'Creo 6.0', 'text': '', 'tags': '', 'url': 'Creo 6.0.html'}, {'title': 'Onshape', 'text': '', 'tags': '', 'url': 'Onshape.html'}]};